import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Guess what color this is.
        </p>
        <div className="color-box"></div>
        <div className="flex-container">
          <div className="flex-box"></div>
          <button className="hex-button">#abc123</button>
          <button>#abc123</button>
          <button>#abc123</button>
        </div>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
